import Data from '../../../../db/db.json'
import { React, Component } from 'react'
import { withRouter } from 'react-router-dom'
import { Paper, Typography } from '@material-ui/core';
import { DataGrid } from '@material-ui/data-grid'

class DataSet extends Component {
    constructor(props) {
        super(props);

        this.state = {
            dataSet: null,
        }
    }

    componentDidMount() {
        const { id } = this.props.match.params;
        this.getDataSet(id);
    }

    getDataSet = (id) => {
        var idDataSet = parseInt(id);
        for (var ds in Data.dataSets) {
            if (Data.dataSets[ds].ObjectID === idDataSet) {
                this.setState({ dataSet: Data.dataSets[idDataSet] });
            }
        }
    }

    bindDataGrid = () => {
        let rows = Data.dataLabels;
        let columns = [
            { title: "id", field: "id", hidden: true },
            { title: "id_File", field: "id_File" },
            { title: "id_DataSet", field: "id_DataSet" },
            { title: "startTime", field: "startTime" },
            { title: "duration", field: "duration" },
            { title: "id_DataType", field: "id_DataType" }
        ];

        return { rows: rows, columns: columns };
    }

    render() {
        const { dataSet } = this.state;

        const data = this.bindDataGrid();

        return (
            <div className="DataSet">
                <p>Displaying Data Set {dataSet !== null ? this.state.dataSet.name : 'null'}...</p>
                <p>This is where a dataset table will go, listing any data points that have been labeled. Also, maybe it will have a list of files included? IDK yet.</p>
                <Paper>
                    <Typography variant="h6">Labeled Data</Typography>
                    <DataGrid 
                        rows={data.rows}
                        columns={data.columns}
                        checkBoxSelection
                        disableSelectionOnClick
                    />
                </Paper>

            </div>
        );
    }
}

export default withRouter(DataSet);
